package com.avit.ads.requestads.cache.bean;

public class ContentCacheBean {

	private String resourcid;
	private String contentPath;
	private String tvns;
	private String expression;
	public String getResourcid() {
		return resourcid;
	}
	public void setResourcid(String resourcid) {
		this.resourcid = resourcid;
	}
	public String getContentPath() {
		return contentPath;
	}
	public void setContentPath(String contentPath) {
		this.contentPath = contentPath;
	}
	public String getTvns() {
		return tvns;
	}
	public void setTvns(String tvns) {
		this.tvns = tvns;
	}
	public String getExpression() {
		return expression;
	}
	public void setExpression(String expression) {
		this.expression = expression;
	}
	
}
